import axios from "axios";
import {
  isContentLoaded,
  setAppartaments,
  setAppliance,
  setCars,
  setFurniture, setHousehold,
  setHouses, setImmovables,
  setMoto, setTransport
} from "../Reducers/UrlReducer";

const setAllSubcategories = (data) => {
  dispatch(setHouses(data[0]));
  dispatch(setAppartaments(data[1]));

  dispatch(setCars(data[2]));
  dispatch(setMoto(data[3]));

  dispatch(setAppliance(data[4]));
  dispatch(setFurniture(data[5]));
}

const setAllCategories = (data) => {

}

export const getSubcategories = () => {
  return (dispatch) => {
    axios.get('http://localhost:8080/subcategory/').then(
        response => {
          setAllSubcategories()
          dispatch(isContentLoaded());
        }
    )
  }
}

export const getCategories = () => {
  return (dispatch) => {
    axios.get('http://localhost:8080/category/').then(
        response => {
          dispatch(setTransport(response.data[0]));
          dispatch(setHousehold(response.data[1]));
          dispatch(setImmovables(response.data[2]));
          dispatch(isContentLoaded());
        }
    )
  }
}
